import TextField from '@mui/material/TextField';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className='container'>
         <h1>ToDo App</h1>

         <div>
         <TextField
        hiddenLabel
        id="filled-hidden-label-normal"
        defaultValue="Normal"
        variant="filled"
      />
         </div>
      </div>
    </div>
  );
}

export default App;
